import React from "react";

const Hero = () => {
  return (
    <div className="flex justify-center items-center gap-16 mt-4">
      <span>Home</span>
      <span>About Us</span>
      <span>Solutions</span>
      <span>
        <img src="images/logo 1.png" alt="logo" />
      </span>
      <span>Blogs</span>
      <span>Trials</span>
      <span>Contact Us</span>
    </div>
  );
};

export default Hero;
